import React from 'react';
import { Splide, SplideSlide } from '@splidejs/react-splide';

const slideImages = [
    '../media/banniere/entree.jpg',
    '../media/banniere/cablage.jpg',
    '../media/banniere/signal.jpg',
    '../media/banniere/ubuntu.png'
  ];

const Banniere = () => {
    return (
      <Splide>
      <SplideSlide>
        <img src={slideImages[0]} alt="Image 1"/>
      </SplideSlide>
      <SplideSlide>
        <img src={slideImages[1]} alt="Image 2"/>
      </SplideSlide>
      <SplideSlide>
        <img src={slideImages[2]} alt="Image 3"/>
      </SplideSlide>
      <SplideSlide>
        <img src={slideImages[3]} alt="Image 4"/>
      </SplideSlide>
    </Splide>
    )
}

export default Banniere;
